import React from 'react';
import Products from './Products';
import './home.css'; 

import useBlobAnimation from './homescript';
const Navbar = ({ links }) => {
  return (
    <nav>
      <ul>
        {links.map((link, index) => (
          <li key={index}><a href={link.href} className="menu">{link.label}</a></li>
        ))}
      </ul>
    </nav>
  );
};

const BouncingBlobs = ({ blobs }) => {
  useBlobAnimation();
  return (
    <div className="bouncing-blobs-container">
      <div className="bouncing-blobs-glass"></div>
      <div className="bouncing-blobs">
        {blobs.map((blob, index) => (
          <div key={index} className={`bouncing-blob bouncing-blob--${blob.color}`}></div>
        ))}
      </div>
    </div>
  );
};

const ReuseHome = () => {
  const links = [
    { href: "/", label: "Home" },
    { href: "/store", label: "Store" },
    { href: "/contact", label: "Contact Us" }
  ];

  const blobs = [
    { color: "blue" },
    { color: "blue" },
    { color: "blue" },
    { color: "light-blue" },
    { color: "purple" },
    { color: "purple" },
    { color: "pink" },
    { color: "pink" }
  ];

  return (
    <div>
      <Navbar links={links} />
      <BouncingBlobs blobs={blobs} />
    </div>
  );
}
function App() {
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <a className="navbar-brand" href='/Products'>Products</a>
        <a className="navbar-brand" href='/ContactUs'>ContactUs</a>
      </nav>
      <Products />
    </div>
  );
}

export function Home() {
  return (
    <div>
      <ReuseHome />
    </div>
  );
}
export default App;
